create table kontenplaylist (
	id_playlist VARCHAR(8) PRIMARY KEY NOT NULL,
	email_pembuat_konten VARCHAR(29) PRIMARY KEY NOT NULL,
	id_konten VARCHAR(8) PRIMARY KEY NOT NULL,
	id_produk VARCHAR(8) PRIMARY KEY NOT NULL,
	FOREIGN KEY (id_playlist) REFERENCES playlist(id_playlist),
	FOREIGN KEY (id_konten) REFERENCES pemasaran(id_lagu),
	FOREIGN KEY (id_produk) REFERENCES pemasaran(id_produk)
);
